import React from 'react';
import '../styles/ProductList.css';
import Blazer from './Images/Blazer_1.jpg';
import Sherwani from './Images/Sherwani_1.jpg';

const products = [
  {
    id: 1,
    name: 'Blazer',
    price: '$150',
    image: Blazer,
  },
  {
    id: 2,
    name: 'Sherwani',
    price: '$200',
    image: Sherwani,
  },
];

const ProductList = () => {
  return (
    <div className="product-list">
      {products.map(product => (
        <div key={product.id} className="product">
          <img src={product.image} alt={product.name} className="product-image" />
          <h2>{product.name}</h2>
          <p>{product.price}</p>
          <button>Sherwani</button>
          <button>Blazer</button>
        </div>
      ))}
    </div>
  );
};

export default ProductList;
